function setResolution (_scale:Number = .5):void {
	CONFIG::AIR {
		var nativeWindow:NativeWindow = stage.nativeWindow;

		var w:Number = Math.round(gameWidth*_scale);
		var h:Number = Math.round(gameHeight*_scale);
		nativeWindow.width = w;
		nativeWindow.height = h;

		if (!CONFIG::MACOS) {
			//not needed for osx
			//nativeWindow.width = w + (w - nativeWindow.stage.width);
			//nativeWindow.height = h + (h - nativeWindow.stage.height);
		}

		nativeWindow.x = (Capabilities.screenResolutionX - nativeWindow.width) / 2;
		nativeWindow.y = (Capabilities.screenResolutionY - nativeWindow.height) / 2;

	}
}

function setQuality(_setting:String = "_"):void {
	switch (_setting) {
		case "_":

		break;
		case "LOW":
			data_scaleFactor = .333333;
			data_gameQuality = "LOW";
		break;
		case "MEDIUM":
			data_scaleFactor = .5;
			data_gameQuality = "MEDIUM";
		break;
		case "HIGH":
			data_scaleFactor = .6666;
			data_gameQuality = "HIGH";
		break;
		case "ULTRA":
			data_scaleFactor = 1;
			data_gameQuality = "ULTRA";
			break;
	}

	visible = false;
	setResolution(data_scaleFactor);
	if (fullscreen) {
		displayFullscreen();
	}
	visible = true;
	saveData();
}

function displaySettings ():void {
	settingsUI = new SettingsUI();
	addChild(settingsUI);
	settingsOpen = true;
	settingsUI.scaleX = settingsUI.scaleY = 2;
}

function displayFullscreen():void {
	trace("Fullscreen ON");

	scaleFactor = data_scaleFactor;
	scaleX = scaleY = scaleFactor;

	stage.fullScreenSourceRect = new Rectangle(0,0, gameWidth*scaleFactor, gameHeight*scaleFactor);
	stage.displayState = StageDisplayState.FULL_SCREEN_INTERACTIVE;

	var pp:PerspectiveProjection = new PerspectiveProjection();
	pp.projectionCenter = new Point((gameWidth*data_scaleFactor) * .5, (gameHeight*data_scaleFactor) * .5);
	this.transform.perspectiveProjection = pp;
}

function displayWindow():void {
	trace("Fullscreen OFF");
	scaleFactor = 1;
	scaleX = scaleY = 1;
	stage.displayState = StageDisplayState.NORMAL;
	fullscreen = false;

	var pp:PerspectiveProjection = new PerspectiveProjection();
	pp.projectionCenter = new Point((gameWidth) * .5, (gameHeight) * .5);
	this.transform.perspectiveProjection = pp;
}

function closeApplication():void {
	CONFIG::AIR {
	NativeApplication.nativeApplication.exit();
	}
}

