var player2Control:PlayerControl;
var playerDefaultControl:PlayerControl;

playerControls = new Array();
devices = new Array();
gameInput = new GameInput();
gameInput.addEventListener(GameInputEvent.DEVICE_ADDED, deviceAdded);
gameInput.addEventListener(GameInputEvent.DEVICE_REMOVED, deviceRemoved);

addController();

function addController():void {
	player1Control = new PlayerControl(0, stage, null, true);
	player2Control = new PlayerControl(0, stage, null, false);
	playerDefaultControl = new PlayerControl(0, stage, null, true);

	addChild(player1Control);
	addChild(player2Control);
	addChild(playerDefaultControl);

	playerControls = [player1Control, player2Control, playerDefaultControl];
}

function controlUpdate():void {
	for (var i:int = 0; i < playerControls.length; i ++) {
		ctrl = playerControls[i];
		if (ctrl) ctrl.update();
	}
}

function deviceAdded(e:GameInputEvent):void {
	for (var i:int = 0; i < playerControls.length; i ++) {
		var c:PlayerControl = playerControls[i];
		if (c) {
			if (c.gamePad.device == null) {
				e.device.enabled = true;
				c.gamePad.insertDevice(e.device);
				devices.push(e.device);

				playerDefaultControl.gamePad = player1Control.gamePad;

				break;
			}
		}
	}

}

function deviceRemoved(e:GameInputEvent):void {
	for (var i:int = 0; i < playerControls.length; i ++) {
		var c:PlayerControl = playerControls[i];
		if (c) {
			if (c.gamePad.device == e.device) {
				c.gamePad.pullDevice();
				break;
			}
		}
	}
}

function numOfDevices():Number {
	var count:Number = 0;
	for (var i:int = 0; i < playerControls.length; i ++) {
		var c:PlayerControl = playerControls[i];
		if (c) {
			if (c.gamePad.device != null) {
				count ++;
			}
		}
	}

	return count;
}

function setMultiPlayerControl ():void {
	trace("gala 1 :: "+player1Control.device);
	trace("gala 2 :: "+player2Control.device);
	//if (numOfDevices() == 1) {
	if (player1Control.gamePad.device && !player2Control.gamePad.device) {

		player1Control.keys.enabled = false;
		player2Control.keys.enabled = true;
		player2Control.applyDefaults();

	}  
	//if (numOfDevices() == 0) {
	if (!player1Control.gamePad.device && !player2Control.gamePad.device) {	
		trace("gala 2");
		player1Control.applyP1Keys();
		player2Control.applyP2Keys();
		player2Control.keys.enabled = true;
	}
}

function killMultiPlayerControl():void {
	player1Control.keys.enabled = true;
	player2Control.keys.enabled = false;
	player1Control.applyDefaults();
	player2Control.applyDefaults();
}

