function playSound(sound:Sound, repeat:int = 0, vol:Number = 1) {
	if (sound) {
		if (!isSoundMute && !sessionIsPaused) {
			soundChannel = sound.play(0, repeat, new SoundTransform(vol*soundVolumeCtrl));
		}
	}
}
function playUISound(sound:Sound, repeat:int = 0, vol:Number = 1) {
	if (!isSoundMute) {
		uiChannel = sound.play(0, repeat);
	}
	uiChannel.soundTransform = new SoundTransform(vol*soundVolumeCtrl);
}
function updateAudio(e:Event):void {
	if (_isFadingOut) {
		if (_iFadeOut > _fadeTo) {
			_iFadeOut --;
			if (!isMusicMute) {
				musicChannel.soundTransform = new SoundTransform((_iFadeOut/_fadeOut)*volumeCtrl);
			}
		} else if (_iFadeOut <= 0) {
			this.dispatchEvent(new Event("MUSIC_FADEOUT_COMPLETE"));
			musicChannel.stop();
			isMusicStopped = true;
			_isFadingOut = false;
		}
	} else if (_isFadingIn) {
		if (_iFadeOut < _fadeOut) {
			_iFadeOut ++;
			if (!isMusicMute) {
				musicChannel.soundTransform = new SoundTransform((_iFadeOut/_fadeOut)*volumeCtrl);
			}
		} 
	}
}
function musicComplete(e:Event):void {
	if (loopFixFlag) {
		if (currentMusic) {
			playMusic(currentMusic);
		}
		loopFixFlag = false;
	}
}

function playMusic(track:Sound, resume:Boolean = false, loop:Number = 9999):void {
	trace("Playing Music :: "+track);
	musicChannel.removeEventListener(Event.SOUND_COMPLETE, musicComplete);
	if (resume) {
		if (currentMusic) {
			loopFixFlag = true;
			musicChannel = currentMusic.play(cacheMusicPos);
			musicChannel.addEventListener(Event.SOUND_COMPLETE, musicComplete);
			cacheMusicPos = 0;
		}
	} else {
		musicChannel = track.play(0, loop);
		musicChannel.addEventListener(Event.SOUND_COMPLETE, musicComplete);
	}

	musicChannel.soundTransform = new SoundTransform(1*volumeCtrl);
	currentMusic = track;

	if (isMusicMute) {
		musicChannel.soundTransform	= new SoundTransform(0);
	}
	isMusicStopped = false;
}
function fadeOutMusic(speed:Number = 1):void {
	if (!isMusicMute) {
		_isFadingOut = true;
		_isFadingIn = false;
		_iFadeOut = _fadeOut * speed;
		_fadeTo = 0;
	}
}
function fadeOutMusicTo(speed:Number = 1, minVol:Number = 20) {
	_isFadingOut = true;
	_isFadingIn = false;
	_iFadeOut = _fadeOut * speed;
	_fadeTo = minVol;
}
function fadeInMusic() {
	_isFadingOut = false;
	_isFadingIn = true;
}

function stopMusic():void {
	cacheMusicPos = musicChannel.position;
	musicChannel.stop();
	isMusicStopped = true;
	trace("Music Stopped :: "+isMusicStopped);
}

