function playContinuous(soundName:String, fadeIn:Boolean = true, _loop:int = 9999):void {
	var sound:Sound = this[soundName];
	if (sound) {

		var vol:Number;
		vol = 1*soundVolumeCtrl;

		if (isSoundMute || sessionIsPaused) {
			vol = 0;
			continuousVol = 0;
		}

		switch (soundName) {
			case "sndHoly4":
				sndHoly4Channel.stop();
				sndHoly4Channel = sndHoly4.play(0, _loop, new SoundTransform(vol));
			break;
			case "sndStoneDrag":
				sndStoneDragChannel.stop();
				sndStoneDragChannel = sndStoneDrag.play(0, _loop, new SoundTransform(vol));
			break;
			case "sndWind":
				sndWindChannel.stop();
				sndWindChannel = sndWind.play(0, _loop, new SoundTransform(vol));
			break;
			case "sndSkidLong":
				if (!sndSkidLongPlaying) {
					if (sndSkidLongVol <= .1) {
						sndSkidLongChannel.stop();
						sndSkidLongChannel = sndSkidLong.play(0, _loop, new SoundTransform(vol));
						sndSkidLongPlaying = true;
					} else {
						sndSkidLongPlaying = true;
					}
				}
			break;
			case "sndRackPoints1":
				sndRackPointsChannel.stop();
				sndRackPointsChannel = sndRackPoints1.play(0, _loop, new SoundTransform(vol*.2));
			break;
			case "sndRackPoints2":
				sndRackPointsChannel.stop();
				sndRackPointsChannel = sndRackPoints2.play(0, _loop, new SoundTransform(vol*.2));
			break;
		}
	}
}
function stopContinuous(soundName:String):void {
	switch (soundName) {
		case "sndHoly4":
			sndHoly4Channel.stop();
		break;
		case "sndStoneDrag":
			sndStoneDragChannel.stop();
		break;
		case "sndWind":
			sndWindChannel.stop();
		break;
		case "sndSkidLong":
			if (sndSkidLongPlaying) {
				//sndSkidLongChannel.stop();
				sndSkidLongPlaying = false;
			}
		break;
		case "sndRackPoints":
		case "sndRackPoints1":
		case "sndRackPoints2":
			sndRackPointsChannel.stop();
		break;
	}
}
function stopAllContinuous(fadeOut:Boolean = true):void {
	sndHoly4Channel.stop();
	sndStoneDragChannel.stop();
	sndWindChannel.stop();
	sndSkidLongChannel.stop();
	sndRackPointsChannel.stop();
}
function pauseContinuous():void {
	updateContinuousVolume(0);
}
function resumeContinuous():void {
	updateContinuousVolume(1);
}
function updateContinuousVolume(_vol:Number = 1):void {
	var  v = _vol * soundVolumeCtrl;
	sndHoly4Channel.soundTransform = new SoundTransform(v);
	sndStoneDragChannel.soundTransform = new SoundTransform(v);
	sndWindChannel.soundTransform = new SoundTransform(v);
	sndSkidLongChannel.soundTransform = new SoundTransform(v);
}

/// THE MIGHTY UPDATE ------------
//-------------------------------
function soundUpdate():void {
	if (sndSkidLongPlaying) {
		if (sndSkidLongVol < 1) {
			sndSkidLongVol += .05;
			if (isSoundMute) sndSkidLongChannel.soundTransform = new SoundTransform(0);
			else sndSkidLongChannel.soundTransform = new SoundTransform(sndSkidLongVol*soundVolumeCtrl);
		}
	} else {
		if (sndSkidLongVol > 0) {
			sndSkidLongVol -= .05;
			if (sndSkidLongVol< .1) {
				sndSkidLongVol = 0;
				sndSkidLongChannel.stop();
			} else {
				if (isSoundMute) sndSkidLongChannel.soundTransform = new SoundTransform(0);
				else sndSkidLongChannel.soundTransform = new SoundTransform(sndSkidLongVol*soundVolumeCtrl);
			}
		}
	}
}


function muteSound():void {
	isSoundMute = true;
}

function muteMusic():void {
	isMusicMute = true;
	musicChannel.soundTransform = new SoundTransform(0);
}

function unMuteMusic():void {
	isMusicMute = false;
	musicChannel.soundTransform = new SoundTransform(volumeCtrl);
}
function unMuteSound():void {
	isSoundMute = false;
}

