function dataGetWeaponBoosters(playerID:int = 0):Array {
	var arr:Array = new Array();
	var weapID:Number = data_equiptedWeapon;
	if (playerID == 2) weapID = data_equiptedWeapon_p2;

	var arrBooster:Array = this["data_weap"+weapID+"_Boosters"];
	var arrABooster:Array = this["data_weap"+weapID+"_ABoosters"];

	if (arrABooster) {
		for (i = 0; i < arrABooster.length; i ++) {
			//[id, ability]
			arr.push([arrABooster[i], true]);
		}
	}
	if (arrBooster) {
		for (var i:int = 0; i < arrBooster.length; i ++) {
			//[id, ability]
			arr.push([arrBooster[i], false]);
		}
	}
	return arr;
}

function dataGetWeapBoosterFromID(_id:int):Array {
	var arr:Array = new Array();
	var arrBooster:Array = this["data_weap"+_id+"_Boosters"];
	var arrABooster:Array = this["data_weap" + _id + "_ABoosters"];

	if (arrABooster) {
		for (var i:int = 0; i < arrABooster.length; i ++) {
			arr.push([arrABooster[i], true]);
		}
	}
	if (arrBooster) {
		for (i = 0; i < arrBooster.length; i ++) {
			arr.push([arrBooster[i], false]);
		}
	}

	return arr;
}
function boosterInputByName(s:String, playerID:int = 0):Boolean {
	var _c:PlayerControl;
	var p2String:String = "";
	if (playerID == 2) {
		_c = player2Control;
		p2String = "_p2";
	} else {
		_c = player1Control;
	}

	if (_c.ctrl_char_booster1) {
		if (dataGetGearName(this["data_equiptedGear0"+p2String]) == s) {
			return true;
		}
	}
	if (_c.ctrl_char_booster2) {
		if (dataGetGearName(this["data_equiptedGear1"+p2String]) == s) {
			return true;
		}
	}

	return false;
}

function dataGetWeaponName(id:int):String {
	return this["data_weap" + id + "_name"];
}
function dataGetGearName(id:int):String {
	return this["data_gear" + id + "_name"];
}

function dataIsGearEquipt(gearName:String, playerID:int = 0):Boolean {
	if (playerID == 2) {
		for (var i:int = 0; i < 4; i ++) {
			if (gearName == this["data_gear"+this["data_equiptedGear"+i+"_p2"]+"_name"]) {
				return true;
			}
		}
	} else {
		for (i = 0; i < 4; i ++) {
			if (gearName == this["data_gear"+this["data_equiptedGear"+i]+"_name"]) {
				return true;
			}
		}
	}
	return false;
}

