	return gearUnlocked[id];
}

function unlockWeapon(id:int, doQue:Boolean = false):void {
	trace("Weapon Unlock :: "+(id-1));
	weaponsUnlocked[id] = true;
	if (doQue) addToUnlockQue(new UnlockQue(dataGetWeaponName(id-1), id-1, "WEAPON"));

	weaponsUnlockedNum = 0;
	for (var i:int = 0; i < weaponsUnlocked.length; i ++) {
		if (weaponsUnlocked[i]) {
			weaponsUnlockedNum ++;
		} else {
			break;
		}
	}

	saveData();
}
function unlockGear(id:int):void {
	trace("Gear Unlock :: "+(id-1));
	gearUnlocked[id] = true;
	//addToUnlockQue(new UnlockQue(dataGetGearName(id-1), id-1, "GEAR"));

	gearUnlockedNum = 0;
	for (var i:int = 0; i < gearUnlocked.length; i ++) {
		if (gearUnlocked[i]) {
			gearUnlockedNum ++;
		} else {
			break;
		}
	}

	saveData();
}
