function unlockLevel(id:int):void {
	trace("Unlock Level :: "+(id-1));
	levelsUnlocked[id-1] = true;
	if (gameMode == STORY) data_continueLevel = sessionLevel;

	levelsUnlockedNum = 0;
	for (var i:int = 0; i < levelsUnlocked.length; i ++) {
		if (levelsUnlocked[i]) {
			levelsUnlockedNum ++;
		} else {
			break;
		}
	}



	saveData();
}

function unlockVandheer():void {
	if (!char_vandheer_unlocked) {

		if (levelsUnlocked[levelsUnlocked.length-1]) {
			char_vandheer_unlocked = true;
			addToUnlockQue(new UnlockQue("VANDHEER", 1, "CHARACTER"));
		}

	}
	//saveData(); already gets called from unlockLevel()
}
function unlockSuperLoneWarrior():void {
	if (!char_SuperLoneWarrior_unlocked) {

		if (levelsUnlocked[levelsUnlocked.length-1]) {
			char_SuperLoneWarrior_unlocked = true;
			addToUnlockQue(new UnlockQue("SUPERLONEWARRIOR", 2, "CHARACTER"));
		}

	}
	saveData();
}

function collectKey(levelNum:int):void {
	for (var i:int = 0; i < keysUnlocked.length; i ++) {
		if (keysUnlocked[i][1] == "lvl"+levelNum) {
			keysUnlocked[i][0] = true;
			break;
		}
	}
	saveData();
}
function isKeyCollected(levelNum:int):Boolean {
	var b:Boolean;
	for (var i:int = 0; i < keysUnlocked.length; i ++) {
		if (keysUnlocked[i][1] == "lvl"+levelNum) {
			b = keysUnlocked[i][0];
			break;
		}
	}
	return b;
}

function numofKeysCollected():int {
	var val:int = 0;

	for (var i:int = 0; i < keysUnlocked.length; i ++) {
		if (keysUnlocked[i][0]) {
			val ++;
		}
	}	
	return val;
}
function allKeysCollected():Boolean {
	var b:Boolean = true;

	for (var i:int = 0; i < keysUnlocked.length; i ++) {
		if (keysUnlocked[i][0] == false) {
			b = false;
			break;
		}
	}	
	return b;
}
function unlockAllKeys():void {
	for (var i:int = 0; i < keysUnlocked.length; i ++) {
		if (keysUnlocked[i][0] == false) {
			keysUnlocked[i][0] = true;
		}
	}	
}

var unlockQueArr:Array = new Array();
function addToUnlockQue(que:UnlockQue):void {
	unlockQueArr.push(que);
	trace(que.itemID + ", " + que.itemName + ", " + que.itemType);
}

function unlockAll():void {
	for (var i:int = 0; i < data_numofWeapons; i ++) {
		weaponsUnlocked[i] = true;
	}
	for (i = 0; i < data_numofBoosters; i ++) {
		gearUnlocked[i] = true;
	}
	for (i = 0; i < levelsUnlocked.length; i ++) {
		levelsUnlocked[i] = true;
	}

	unlockAllKeys();
	unlockVandheer();
	//unlockSuperLoneWarrior();

	levelsUnlockedNum = levelsUnlocked.length;
	weaponsUnlockedNum = weaponsUnlocked.length;
	gearUnlockedNum = gearUnlocked.length;
}

function unlockWave(_stageid:int, _waveNum:int):void {
	//startingWaveUnlockArr
	startingWaveUnlockArr[_stageid] = _waveNum;

	var s:String = "";
	if (sessionWave > 1) {
		canStartFromUnlockedWave = true;
		s = "can do!";
	}

	trace("////////////WAVES UNLOCKS :: ");
	trace(startingWaveUnlockArr);

	saveData();
}

