function loadData():void {
	trace("Loading Data");

	CONFIG::AIR {
		var savename:String = "SaveData_v2.sav";
		var savefile:File;
		savefile=File.documentsDirectory.resolvePath("My Games/Armed with Wings Rearmed/" + savename);
		if(savefile.exists)
		{
			var filestream:FileStream=new FileStream();	
			filestream.open(savefile, FileMode.READ);
			var $savedata:Object = filestream.readObject();
			filestream.close();

			isSoundMute = $savedata.isSoundMute;
			isMusicMute = $savedata.isMusicMute;
			firstRun = $savedata.firstRun;
			fullscreen = $savedata.fullscreen;

			bestRun = $savedata.bestRun;
			storySessionData = $savedata.storySessionData;
			survivalScoreData = $savedata.survivalScoreData;

			VFXStyle = $savedata.VFXStyle;

			data_equiptedWeapon = $savedata.data_equiptedWeapon;
			data_equiptedGear0 = $savedata.data_equiptedGear0;
			data_equiptedGear1 = $savedata.data_equiptedGear1;
			data_equiptedGear2 = $savedata.data_equiptedGear2;
			data_equiptedGear3 = $savedata.data_equiptedGear3;

			data_equiptedWeapon_p2 = $savedata.data_equiptedWeapon_p2;
			data_equiptedGear0_p2 = $savedata.data_equiptedGear0_p2;
			data_equiptedGear1_p2 = $savedata.data_equiptedGear1_p2;
			data_equiptedGear2_p2 = $savedata.data_equiptedGear2_p2;
			data_equiptedGear3_p2 = $savedata.data_equiptedGear3_p2;

			levelsUnlockedNum = $savedata.levelsUnlockedNum;
			weaponsUnlockedNum = $savedata.weaponsUnlockedNum;
			gearUnlockedNum = $savedata.gearUnlockedNum;

			if ($savedata.weaponsListingNew) weaponsListingNew = $savedata.weaponsListingNew;
			if ($savedata.passiveListingNew) passiveListingNew = $savedata.passiveListingNew;
			if ($savedata.abilityListingNew) abilityListingNew = $savedata.abilityListingNew;

			juggleModeBest = $savedata.juggleModeBest;
			data_orbsCollected = $savedata.data_orbsCollected;
			data_keysCollected = $savedata.data_keysCollected;

			if ($savedata.char_loneWarrior_unlocked) char_loneWarrior_unlocked = $savedata.char_loneWarrior_unlocked;
			if ($savedata.char_vandheer_unlocked) char_vandheer_unlocked = $savedata.char_vandheer_unlocked;
			if ($savedata.char_SuperLoneWarrior_unlocked) char_SuperLoneWarrior_unlocked = $savedata.char_SuperLoneWarrior_unlocked;
			if ($savedata.char_eivana_unlocked) char_eivana_unlocked = $savedata.char_eivana_unlocked;

			//load weapon booster sets
			var arr:Array = $savedata.weaponBoosterSets;
			if (arr) {
				for (var i:int = 0; i < arr.length; i ++) {
					var s:String = "data_weap"+i+"_assignedBoosters";
					this[s] = arr[i];
				}
			}

			unlockScore = $savedata.unlockScore;
			data_continueLevel = $savedata.data_continueLevel;
			if (!data_continueLevel > 0) data_continueLevel = 1;
			data_continueDifficulty = $savedata.data_continueDifficulty;
			if ($savedata.heroName != undefined) heroName = $savedata.heroName;
			if (data_continueDifficulty != gameDifficultyNormal && data_continueDifficulty != gameDifficultyfutile) data_continueDifficulty = gameDifficultyNormal;
			if (survivalScoreData == null) 
				survivalScoreData = [[0],[0],[0],[0],[0],[0],[0],[0],[0]];
			if (!juggleModeBest) juggleModeBest = 0; 
			if (!data_orbsCollected) data_orbsCollected = 0;
			if (!data_keysCollected) data_keysCollected = 0;
			if ($savedata.keysUnlocked) keysUnlocked = $savedata.keysUnlocked;
			if ($savedata.acheivementsUnlocked) acheivementsUnlocked = $savedata.acheivementsUnlocked;
			if ($savedata.startingWaveUnlockArr) startingWaveUnlockArr = $savedata.startingWaveUnlockArr;
			if ($savedata.canStartFromUnlockedWave) canStartFromUnlockedWave = $savedata.canStartFromUnlockedWave;

			if ($savedata.volumeCtrl) volumeCtrl = $savedata.volumeCtrl-1;
			if ($savedata.soundVolumeCtrl) soundVolumeCtrl = $savedata.soundVolumeCtrl-1;	

			trace("loading volume :: "+$savedata.volumeCtrl);
			trace("loading Sound volume :: "+$savedata.soundVolumeCtrl);
			trace("CHEEKYY MONEKY:: "+$savedata.data_particlesEnabled);

			if ($savedata.VFXID) VFXID = $savedata.VFXID;
			if ($savedata.data_scaleFactor) data_scaleFactor = $savedata.data_scaleFactor;
			if ($savedata.data_gameQuality) data_gameQuality = $savedata.data_gameQuality;
			data_particlesEnabled = $savedata.data_particlesEnabled;
			data_hideHud = $savedata.data_hideHud;

			//apply unlocks to arrays
			for (i = 0; i < levelsUnlocked.length; i ++) {
				if (i < levelsUnlockedNum) {
					levelsUnlocked[i] = true;
				} else {
					levelsUnlocked[i] = false;
				}
			}
			for (i = 0; i < weaponsUnlocked.length; i ++) {
				if (i < weaponsUnlockedNum) {
					weaponsUnlocked[i] = true;
				} else {
					weaponsUnlocked[i] = false;
				}
				if (i < data_numofWeapUNLOCKED) {
					weaponsUnlocked[i] = true;
				}
			}
			for (i = 0; i < gearUnlocked.length; i ++) {
				if (i < gearUnlockedNum) {
					gearUnlocked[i] = true;
				} else {
					gearUnlocked[i] = false;
				}
			}

		}
		else
		{
			trace("***[Error]*** Save file does not exist!");
		}
		savingComplete(null);
	}
}

