function dataStartNewGame ():void {
	trace("starting new game");
	resetSessionData();
	startingLevel = 1;
	sessionContinuedGame = false;
	if (gameDifficulty == gameDifficultyfutile) {
		sessionTimeString = "00:00";
		sessionTimeInt = 0;
	} else {
		sessionTimeString = "00:00";
		sessionTimeInt = 0;
	}
	if (gameDifficulty == gameDifficultySuperFutile) {

		sessionTimeString = "00:00";
		sessionLives = 1;
	}
	saveStoryData();
}
