// Scoring functions ////////////////////////////////////////
function scoreAttack():void {
	sessionCombo ++;
	if (sessionCombo > sessionTopCombo) {
		sessionTopCombo = sessionCombo;
	}

	if (sessionCombo >0) {
		sessionScore += 1 * sessionCombo;
	} else {
		sessionScore += 1;
	}
}
function scorePowerStrike(powerLevel:Number):void {
	sessionScore += powerLevel;
}
function scoreSubtractDamage(dmg:Number):void {
	if (gameMode != SURVIVAL) {
		sessionScore -= dmg;
		if (sessionScore <0) sessionScore = 0;
	}
}
function scoreOrb():void {
	sessionScore ++;
	data_orbsCollected ++;
}
function scoreBonus(type:String, points:Number):void {
	sessionScore += points;
}
