function saveBestRun ():void {
	if (gameMode == STORY) {
		var newBest:Boolean = false;
		if (bestRun[10]) {
			if (sessionTimeInt < bestRun[10]) {
				lastBestTimeString = bestRun[2];
				newBest = true;
			}
		} else {
			newBest = true;
		}

		if (newBest) {
			sessionNewTimeStoryRecord = true;
			//score
			bestRun[0] = sessionScore;
			//level
			bestRun[1] = sessionLevel;
			//time
			bestRun[2] = sessionTimeString;
			//combo
			bestRun[3] = sessionCombo;
			//lives
			bestRun[4] = sessionLives;
			//weapon
			bestRun[5] = data_equiptedWeapon;
			//gear
			bestRun[6] = data_equiptedGear0;
			bestRun[7] = data_equiptedGear1;
			bestRun[8] = data_equiptedGear2;
			bestRun[9] = data_equiptedGear3;

			//timeInt
			bestRun[10] = sessionTimeInt;
			//difficulty
			bestRun[11] = gameDifficulty;

