				trace("Score not beaten");
			}
		} else {

			add = true;
			trace("NEW HIGHSCORE!");
		}
	}

	if (add) {
		lastBestScoreString = survivalScoreData[sessionSurvivalArena][0];
		sessionNewScoreSurvival = true;
		//#0 Score, #1 Wave, #2 HeroName, #3 Weapons, #4 Gear1, #5 Gear2, #6 Gear3, #7 Gear4, #8 Diffulcty
		survivalScoreData[sessionSurvivalArena] = [sessionScore, sessionWave, heroName, 
		data_equiptedWeapon, data_equiptedGear0, data_equiptedGear1, data_equiptedGear2, data_equiptedGear3, gameDifficulty];
	}

	saveData();
}

