function fixStoryData ():void {
	trace("Checking Story Data :: "+storySessionData);
	var adjusting:Boolean = false;

	if (storySessionData == null) {
		storySessionData = new Array();
		adjusting = true;
	}
	//Level
	if (!storySessionData[0] > 0) {
		storySessionData[0] = 1;
		adjusting = true;
	}
	//time
	if (storySessionData[1] == undefined) {
		storySessionData[1] = String(sessionTimeString);
		adjusting = true;
	}
	//weapon
	if (storySessionData[2] == undefined) {
		storySessionData[2] = 0;
		adjusting = true;
	}
	//gear
	if (storySessionData[3] == undefined) {
		storySessionData[3] = 0;
		adjusting = true;
	}
	if (storySessionData[4] == undefined) {
		storySessionData[4] = 0;
		adjusting = true;
	}
	if (storySessionData[5] == undefined) {
		storySessionData[5] = 0;
		adjusting = true;
	}
	if (storySessionData[6] == undefined) { 
		storySessionData[6] = 0;
		adjusting = true;
	}
	//character
	if (storySessionData[7] == undefined) {
		storySessionData[7] = "LONEWARRIOR";
		adjusting = true;
	}
	//character
	if (storySessionData[8] == undefined) {
		storySessionData[8] = "NORMAL";
		adjusting = true;
	}
	//game in progress
	if (storySessionData[9] == undefined) {
		storySessionData[9] = false;
		adjusting = true;
	}
	//time
	if (storySessionData[10] == undefined) {
		storySessionData[10] = "????";
		adjusting = true;
	}

	if (adjusting) {
		trace("Story Data Adjusted :: "+storySessionData);
	}
}

function getYYMMDD():String
{
	var dateObj:Date = new Date();
	var year:String = String(dateObj.getFullYear());
	var month:String = String(dateObj.getMonth() + 1);
	if (month.length == 1) {
		month = "0"+month;
	}
	var date:String = String(dateObj.getDate());
	if (date.length == 1) {
		date = "0"+date;
	}
	return year.substring(2, 4)+" / "+month+" / "+date;
}

