CONFIG::STEAM {
function onResponse (e:SteamEvent):void 
{
	switch (e.req_type) {
		case SteamConstants.RESPONSE_OnFindLeaderboard:
			handle = steamworks.findLeaderboardResult();
			if (steamUploadScore) {
				trace("uploading score to steam");
				steamworks.uploadLeaderboardScore(handle, UserStatsConstants.UPLOADSCOREMETHOD_KeepBest, steamScore, null);
				steamUploadScore = false;
			}
			break;
		case SteamConstants.RESPONSE_OnUploadLeaderboardScore:
			trace("score uploaded");
			steamworks.uploadLeaderboardScoreResult();
			break;
		case SteamConstants.RESPONSE_OnUserStatsReceived:
			unlockSteamAchievement();	
			break;
	}
}
}

