		sndCtrl.playMusic(sndCtrl.track11);
		sndCurrentTrack = sndCtrl.track11;
	} else if (levelNum >= 14) {
		sndCtrl.playMusic(sndCtrl.track2);
		sndCurrentTrack = sndCtrl.track2;
