function update (e:Event):void {
	if (!sessionUpdateLock) {
		soundUpdate();
		controlUpdate();
		hud.update();


		if (!_pause) {
			if (!freezeFrame.freezeOn())
				game.update();
				//awarnessManager.update();

			if (game.vcam) game.vcam.update();

			if (!freezeFrame.freezeOn()) {
				if (game.particleLayer) game.particleLayer.update();
				if (game.groundRoof) game.groundRoof.update();
				if (sky && sky.update) sky.update();
			}
			//gifRecorder.update();
		}
	}
	if (DebugControl.skipLevels) skipLevels();//for debug
}

