//Color control
function updateStyle(e:Event = null):void {
	if (!colorForced) {
		for (var i:int = 0; i < game.objectsArr.length; i ++) {
			var clip:MovieClip = game.objectsArr[i].colorer;
			if (clip) {

				clip.changeColor(VFXStyle, true);
			}
		}
		for (i = 0; i < game.enemiesArr.length; i ++) {
			clip = game.enemiesArr[i].colorer;
			if (clip) {
				clip.changeColor(VFXStyle, true);
			}
		}

		zoom.colorer.changeColor(VFXStyle);
		sky.colorer.changeColor(VFXStyle);

	}
}

function forceStyle(style:String):void {
	colorForced = true;
	switch (style) {
		case VFXInvert:
			sky.gotoAndStop(4);
			zoom.colorer.changeColor(VFXInvert);
			sky.colorer.changeColor(VFXNone);
			break;
		case VFXColor: 
			break;
		case VFXDark:
			zoom.colorer.changeColor(VFXNone);
			sky.colorer.changeColor(VFXNone);
			break;
		case VFXNone:
			zoom.colorer.changeColor(VFXNone);
			sky.colorer.changeColor(VFXNone);
			break;
		default:
			zoom.colorer.changeColor(VFXNone);
			sky.colorer.changeColor(VFXNone);
			break;
	}
}

