function skipLevels():void {

	if (MovieClip(root).player1Control.ctrl_debug_skipF) {
		if (!keyFilter1) {
			gameData.sessionSpawnID = 0;
			colorForced = false;
			levelNum ++;
			gameData.sessionLevel = levelNum;
			gameData.sessionLevelRestart = false;
			game.closeLevel();	
			game.init();
			game.gotoAndPlay(game.currentFrame+1);
			transition.gotoAndPlay("OPENLEVEL");
			keyFilter1 = true;
		}
	} else {
		keyFilter1 = false;
	}

	if (MovieClip(root).player1Control.ctrl_debug_skipB) {
		if (!keyFilter2) {
			gameData.sessionSpawnID = 0;
			colorForced = false;
			levelNum --;
			gameData.sessionLevel = levelNum;
			gameData.sessionLevelRestart = false;
			game.closeLevel();	
			game.init();
			game.gotoAndPlay(game.currentFrame-3);
			transition.gotoAndPlay("OPENLEVEL");
			keyFilter2 = true;
		}
	} else {
		keyFilter2 = false;
	}
}

