	_isFadingIn = true;

	switch (id) {
		case 1:
			clip = new Cutscene1();
		break;
		case 2:
			clip = new Cutscene2();
		break;
		case 3:
			clip = new Cutscene3();
		break;
		case 4:
			clip = new Cutscene4();
		break;
		case 5:
			if (gameMode == STORY) {
				uploadTime("Story Time", sessionTimeInt);
				uploadScore("Story Score", sessionScore);
			}
			if (gameMode == STORY) this.dispatchEvent(new Event("STORYCOMPLETED"));
			if (gameMode == LEVELSELECT) this.dispatchEvent(new Event("LEVELCOMPLETED"));
			unlockVandheer();
			clip = new Cutscene6();
		break;
		case 6:
			clip = new Cutscene7();
		break;
	}

	addChild(clip);
	addChild(skip)
	clip.scaleX = clip.scaleY = 2;
	skip.gotoAndPlay(1);
	clip.addEventListener("COMPLETE", end);
	addEventListener("ACHIEVEDISPLAYCOMPLETE", resume);
	this.addEventListener(Event.ENTER_FRAME, cinematicUpdate);
	skipCool = 60;
	forceDisplayAchievePopup();

	if (uiAchievePopup.currentFrame != 1) {
		clip.stop();
	}


}
function resume(e:Event):void {
	clip.play();
}

function end (e:Event):void {
	stopAllContinuous();
	stopMusic();

	clip.removeEventListener("COMPLETE", end);
	this.removeEventListener(Event.ENTER_FRAME, cinematicUpdate);
	removeEventListener("ACHIEVEDISPLAYCOMPLETE", resume);
	stopAllClips(clip);
	removeChild(clip);

	cinemaText.visible = false;
	cinemaText2.visible = false;
	cinemaText.gotoAndStop(1);
	cinemaText2.gotoAndStop(1);

	clip = null;

	switch (currentFrameLabel) {
		case "cutscene1":
			//Intro
			startingLevel = 1;
			fromCutscenetoGame = false;
			gotoAndPlay(1, "Game");
		break;		
		case "cutscene2":
			//Beast Defeat
			startingLevel = 14;
			fromCutscenetoGame = true;
			gotoAndPlay(1, "Game");

			if (MovieClip(root).PAX) {
				startingLevel = 1;
				gameCompleteResults();
			}

		break;
		case "cutscene3":
			//final cutscene
			startingLevel = 40;
			fromCutscenetoGame = true;
			gotoAndPlay(1, "Game");
			//gameCompleteResults();
			//gotoAndStop(1, "Credits");
			break;
		case "cutscene4":
			//Enter Final Battle
			startingLevel = 39;
			fromCutscenetoGame = true;
			gotoAndPlay(1, "Game");
		break;
		case "cutscene5":
			fromCutscenetoGame = false;
			gotoAndStop(1, "Credits");
			break;
		break;
		case "cutscene6":
			//Castle in sight
			startingLevel = 33;
			fromCutscenetoGame = true;
			gotoAndPlay(1, "Game");
		break;
	}
}

function stopAllClips(mc:MovieClip):void
{
	mc.stop();
    var n:int = mc.numChildren;
    for (var i:int=0;i<n;i++)
    {
        var clip:MovieClip = mc.getChildAt(i) as MovieClip;
        if (clip)
            clip.stop();
    }
}

